import React from 'react';
const Nav = () => {
    return (
        <nav className='nav'>
            <div><a>Profile</a></div>
            <div><a>Messages</a></div>
            <div><a>News</a></div>
            <div><a>Music</a></div>
            <div><a>Settings</a></div>

        </nav>
    )
}

export  default Nav;
